        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);*/
        //this.GetRepNames = this.GetRepNames.bind(this);
      } 
  GetRepNames()
  {
    fetch("/representatives" + "?s1=" + this.props.constituent['s1'] + '&s2=' + this.props.constituent['s2']+ '&h0=' + this.props.constituent['h0'], {
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }

    }).then((response) => response.json()).then((data) => {
      console.log(data)
      }
      );

    
  }
  componentDidMount() 
  {
    this.GetRepNames() 
  }
  componentDidUpdate() 
  {
    this.GetRepNames()
  }
  render() 
  {
    return (
      <div>Representatives Page
    <button><img src={backIcon} alt="my image" onClick={() => this.props.setConstituent(null)} /></button>
    <div> Address
          <p>
              {this.props.constituent.street} St. {this.props.constituent.city} {this.props.constituent.zipcode}
        </p>
    </div>
        <div>Senator 1</div>
        <div>Senator 2</div>
        <div>House Representative</div>
      </div>
   
    )
  }
}
